import React from 'react'
import CIcon from '@coreui/icons-react'
import { freeSet } from '@coreui/icons'
import {getCookie} from '../helpers/sessionCookie.js'


let _navWind =  [

  {
    _tag: 'CSidebarNavDropdown',
    name: 'Monitor',
    icon: <CIcon content={freeSet.cilMonitor} customClasses="c-sidebar-nav-icon"/>,
    _children: [
      {
        _tag: 'CSidebarNavItem',
        name: 'Current Status',
        to: '/dashboard',
        // icon: <CIcon content={freeSet.cilMonitor} customClasses="c-sidebar-nav-icon"/>
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Overview',
        to: '/modules/wind/overview',
        // icon: <CIcon content={freeSet.cilChartPie} customClasses="c-sidebar-nav-icon"/>
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Alerts',
        to: '/modules/wind/overview/alerts',
        // icon: <CIcon content={freeSet.cilChartPie} customClasses="c-sidebar-nav-icon"/>
      },
      {
        _tag: 'CSidebarNavDropdown',
        name: 'Climate',
        route: '/modules/wind/climate',
        // icon: <CIcon content={freeSet.cilCloudy} customClasses="c-sidebar-nav-icon"/>
        _children: [
          {
            _tag: 'CSidebarNavItem',
            name: 'Summary',
            to: '/modules/wind/climate/summary',
          },
          {
            _tag: 'CSidebarNavItem',
            name: 'Trends',
            to: '/modules/wind/climate/trends',
          },
          {
            _tag: 'CSidebarNavItem',
            name: 'Forecast',
            to: '/modules/wind/climate/forecast',
          },
        ]
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Data Availability  ',
        to: '/modules/wind/data-availability',
        // icon: <CIcon name="cil-list-rich" customClasses="c-sidebar-nav-icon"/>
      },
    ]
  }
]

let _navSolar =  [

  {
    _tag: 'CSidebarNavDropdown',
    name: 'Monitor',
    icon: <CIcon content={freeSet.cilMonitor} customClasses="c-sidebar-nav-icon"/>,
    _children: [
      {
        _tag: 'CSidebarNavItem',
        name: 'Current Status',
        to: '/dashboard',
        // icon: <CIcon content={freeSet.cilMonitor} customClasses="c-sidebar-nav-icon"/>
      },
      {
        _tag: 'CSidebarNavItem',
        name: 'Overview',
        to: '/modules/solar/overview',
        // icon: <CIcon content={freeSet.cilChartPie} customClasses="c-sidebar-nav-icon"/>
      },
      {
        _tag: 'CSidebarNavDropdown',
        name: 'Climate',
        route: '/modules/solar/climate',
        // icon: <CIcon content={freeSet.cilCloudy} customClasses="c-sidebar-nav-icon"/>
        _children: [
          {
            _tag: 'CSidebarNavItem',
            name: 'Trends',
            to: '/modules/solar/climate/trends',
          },
          {
            _tag: 'CSidebarNavItem',
            name: 'Forecast',
            to: '/modules/solar/climate/forecast',
          },
        ]
      },
    ]
  },
  {
    _tag: 'CSidebarNavDropdown',
    name: 'Analyze',
    route: '/modules/wind/analyze',
    icon: 'cil-graph',
    _children: [
      {
        _tag: 'CSidebarNavItem',
        name: 'Performance',
        to: '/modules/wind/performance',
        // icon: <CIcon content={freeSet.cilChartLine} customClasses="c-sidebar-nav-icon"/>
      },
    ]
  },
]

let _nav;
if (getCookie('parkType') == solar) {
  _nav = _navSolar
} else {
  _nav = _navWind
}

export default _nav
